import React from "react";
import "./OnBording1.css";

function OnBording({ Heading }) {
  return (
    <div className="OnBording1">
      <div className="OnBording1_inner">
        <div className="OnBording1_inner_Top">
          <h5>
            Food-<span>D-2</span>
          </h5>
        </div>
        <div className="OnBording1_inner_Bottom">
          <h1>{Heading}</h1>
          <h5>
            Discover delicious food from the amazing <br /> restaurants near you
          </h5>
          <button>NEXT</button>
        </div>
      </div>
    </div>
  );
}

export default OnBording;
